import * as React from "react";
import { NextPage } from "next";
import { NenchoList } from "../components/nenchoList";
import Layout from "../components/layout";

interface NenchoProps {
  taskList?: Nencho[];
  error?: { status: string; message: string };
  token?: string; // withAuth HOCからもらったtoken
}
interface Nencho {
  id: string;
  title: string;
  dueDate: string;
  status: string;
}
const nencho = ["テスト１", "テスト２", "テスト３", "テスト４", "テスト５"];
const status = ["入力済", "未入力", "確認して下さい"];

const Nencho: NextPage<NenchoProps> = props => {
  return (
    <Layout title="2020年年末調整">
      <div>
        {nencho.map(task => {
          return (
            <NenchoList title={task} status="ここに「status」を持ってきたい" />
          );
        })}
      </div>
    </Layout>
  );
};

export default Nencho;
